CREATE TABLE IF NOT EXISTS boundaries (
	name_en varchar NULL,
	admin_level int4 NULL,
	tags hstore NULL,
	boundary geometry NULL,
	priority bool NULL,
	loaded bool NULL,
	id serial4 NOT NULL
);

CREATE INDEX CONCURRENTLY IF NOT EXISTS boundaries_boundary_idx ON public.boundaries USING gist (boundary);

